import './App.css';
import React,{ useState , useEffect } from "react";

function App() {

  const [list, setList] = useState(["Welcome to", "to-do list"]);

  return (
    <div>
        <ul>
          { list.forEach( (item) => {
            <li>{item}</li>
            {console.log(item)}
          })}
        </ul>
    </div>
  );
}

export default App;
